import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import './css/bootstrap.min.css';
import './css/Pretty-Footer.css';
import './css/Contact-Form-Clean.css';
import './css/Login-Form-Dark.css';
import './css/Pretty-Registration-Form.css';
import './css/Registration-Form-with-Photo.css';
import './css/Team-Boxed.css';
import './css/untitled.css';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
